d scent of this Pokémon’s fur. People use it to mark the seasons.'),(586,26,9,'They migrate according to the seasons, so some people call Sawsbuck the harbingers of spring.'),(587,26,9,'The energy made in its cheeks’ electric pouches is stored inside its membrane and released while it is gliding.'),(588,26,9,'For some reason they evolve when they receive electrical energy while they are attacking Shelmet.'),(589,26,9,'These Pokémon evolve by wearing the shell covering of a Shelmet. The steel armor protects their whole body.'),(590,26,9,'It lures Pokémon with its pattern that looks just like a Poké Ball, then releases poison spores.'),(591,26,9,'It lures prey close by dancing and waving its arm caps, which resemble Poké Balls, in a swaying motion.'),(592,26,9,'If its veil-like arms stun and wrap a foe, that foe will be dragged miles below the surface, never to return.'),(593,26,9,'The fate of the ships and crew that wander into Jellicent’s habitat: all sunken, all lost, all vanished.'),(594,26,9,'It gently holds injured and weak Pokémon in its fins. Its special membrane heals their wounds.'),(595,26,9,'They attach themselves to large-bodied Pokémon and absorb static electricity, which they store in an electric pouch.'),(596,26,9,'When attacked, they create an electric barrier by spitting out many electrically charged threads.'),(597,26,9,'It absorbs the iron it finds in the rock while clinging to the ceiling. It shoots spikes when in danger.'),(598,26,9,'They attach themselves to cave ceilings, firing steel spikes at targets passing beneath them.'),(599,26,9,'The two minigears that mesh together are predetermined. Each will rebound from other minigears without meshing.'),(600,26,9,'A minigear and big gear comprise its body. If the minigear it launches at a foe doesn’t return, it will die.'),(601,26,9,'Its red core functions as an energy tank. It fires the charged energy through its spikes into an area.'),(602,26,9,'One alone can emit only a trickle of electricity, so a group of them gathers to unleash a powerful electric shock.'),(603,26,9,'These Pokémon have a big appetite. When they spot their prey, they attack it and paralyze it with electricity.'),(604,26,9,'They crawl out of the ocean using their arms. They will attack prey on shore and immediately drag it into the ocean.'),(605,26,9,'Rumors of its origin are linked to a UFO crash site in the desert 50 years ago.'),(606,26,9,'It uses psychic power to control an opponent’s brain and tamper with its memories.'),(607,26,9,'Litwick shines a light that absorbs the life energy of people and Pokémon, which becomes the fuel that it burns.'),(608,26,9,'It arrives near the moment of death and steals spirit from the body.'),(609,26,9,'The spirits burned up in its ominous flame lose their way and wander this world forever.'),(610,26,9,'They mark their territory by leaving gashes in trees with their tusks. If a tusk breaks, a new one grows in quickly.'),(611,26,9,'A broken tusk will not grow back, so it diligently sharpens its tusks on river rocks after the end of a battle.'),(612,26,9,'Their sturdy tusks will stay sharp even if used to cut steel beams. These Pokémon are covered in hard armor.'),(613,26,9,'Their snot is a barometer of health. When healthy, their snot is sticky and the power of their ice moves increases.'),(614,26,9,'It freezes its breath to create fangs and claws of ice to fight with. Cold northern areas are its habitat.'),(615,26,9,'They are composed of ice crystals. They capture prey with chains of ice, freezing the prey at -148 degrees Fahrenheit.'),(616,26,9,'It evolves when bathed in an electric-like energy along with Karrablast. The reason is still unknown.'),(617,26,9,'When its body dries out, it weakens. So, to prevent dehydration, it wraps itself in many layers of thin membrane.'),(618,26,9,'It conceals itself in the mud of the seashore. Then it waits. When prey touch it, it delivers a jolt of electricity.'),(619,26,9,'In fights, they dominate with onslaughts of flowing, continuous attacks. With their sharp claws, they cut enemies.'),(620,26,9,'Using the long fur on its arms like whips, it launches into combo attacks that, once started, no one can stop.'),(621,26,9,'It warms its body by absorbing sunlight with its wings. When its body temperature falls, it can no longer move.'),(622,26,9,'Ancient science fashioned this Pokémon from clay. It’s been active for thousands of years.'),(623,26,9,'It flies across the sky at Mach speeds. Removing the seal on its chest makes its internal energy go out of control.'),(624,26,9,'Ignoring their injuries, groups attack by sinking the blades that cover their bodies into their prey.'),(625,26,9,'Bisharp pursues prey in the company of a large group of Pawniard. Then Bisharp finishes off the prey.'),(626,26,9,'Their fluffy fur absorbs damage, even if they strike foes with a fierce headbutt.'),(627,26,9,'They will challenge anything, even strong opponents, without fear. Their frequent fights help them become stronger.'),(628,26,9,'They fight for their friends without any thought about danger to themselves. One can carry a car while flying.'),(629,26,9,'Their wings are too tiny to allow them to fly. They guard their posteriors with bones that were gathered by Mandibuzz.'),(630,26,9,'Watching from the sky, they swoop to strike weakened Pokémon on the ground. They decorate themselves with bones.'),(631,26,9,'It draws in air through its tail, transforms it into fire, and uses it like a tongue. It melts Durant and eats them.'),(632,26,9,'They attack in groups, covering themselves in steel armor to protect themselves from Heatmor.'),(633,26,9,'Lacking sight, it’s unaware of its surroundings, so it bumps into things and eats anything that moves.'),(634,26,9,'After it has eaten up all the food in its territory, it moves to another area. Its two heads do not get along.'),(635,26,9,'It responds to movement by attacking. This scary, three-headed Pokémon devours everything in its path!'),(636,26,9,'The base of volcanoes is where they make their homes. They shoot fire from their five horns to repel attacking enemies.'),(637,26,9,'When volcanic ash darkened the atmosphere, it is said that Volcarona’s fire provided a replacement for the sun.'),(638,26,9,'It has a body and heart of steel. It worked with its allies to punish people when they hurt Pokémon.'),(639,26,9,'Spoken of in legend, this Pokémon used its phenomenal power to destroy a castle in its effort to protect Pokémon.'),(640,26,9,'Legends say this Pokémon confounded opponents with its swift movements.'),(641,26,9,'Tornadus expels massive energy from its tail, causing severe storms. Its power is great enough to blow houses away.'),(642,26,9,'As it flies around, it shoots lightning all over the place and causes forest fires. It is therefore disliked.'),(643,26,9,'When Reshiram’s tail flares, the heat energy moves the atmosphere and changes the world’s weather.'),(644,26,9,'Concealing itself in lightning clouds, it flies throughout the Unova region. It creates electricity in its tail.'),(645,26,9,'From the forces of lightning and wind, it creates energy to give nutrients to the soil and make the land abundant.'),(646,26,9,'It generates a powerful, freezing energy inside itself, but its body became frozen when the energy leaked out.'),(647,26,9,'When it is resolute, its body fills with power and it becomes swifter. Its jumps are then too fast to follow.'),(648,26,9,'Its melodies are sung with a special vocalization method that can control the feelings of those who hear it.'),(649,26,9,'This Pokémon existed 300 million years ago. Team Plasma altered it and attached a cannon to its back.'),(650,26,9,'Such a thick shell of wood covers its head and back that even a direct hit from a truck wouldn’t faze it.'),(651,26,9,'They strengthen their lower bodies by running into one another. They are very kind and won’t start fights.'),(652,26,9,'When it takes a defensive posture with its fists guarding its face, it could withstand a bomb blast.'),(653,26,9,'As it walks, it munches on a twig in place of a snack. It intimidates opponents by puffing hot air out of its ears.'),(654,26,9,'When the twig is plucked from its tail, friction sets the twig alight. The flame is used to send signals to its allies.'),(655,26,9,'Using psychic power, it generates a fiery vortex of 5,400 degrees Fahrenheit, incinerating foes swept into this whirl of flame.'),(656,26,9,'It protects its skin by covering its body in delicate bubbles. Beneath its happy-go-lucky air, it keeps a watchful eye on its surroundings.'),(657,26,9,'Its swiftness is unparalleled. It can scale a tower of more than 2,000 feet in a minute’s time.'),(658,26,9,'It appears and vanishes with a ninja’s grace. It toys with its enemies using swift movements, while slicing them with throwing stars of sharpest water.'),(659,26,9,'It has ears like shovels. Digging holes strengthens its ears so much that they can sever thick roots effortlessly.'),(660,26,9,'As powerful as an excavator, its ears can reduce dense bedrock to rubble. When it’s finished digging, it lounges lazily.'),(661,26,9,'Despite the beauty of its lilting voice, it’s merciless to intruders that enter its territory.'),(662,26,9,'The hotter the flame sac on its belly, the faster it can fly, but it takes some time to get the fire going.'),(663,26,9,'When attacking prey, it can reach speeds of up to 310 mph. It finishes its prey off with a colossal kick.'),(664,26,9,'The powder that covers its body regulates its temperature, so it can live in any region or climate.'),(665,26,9,'The beaks of bird Pokémon can’t begin to scratch its stalwart body. To defend itself, it spews powder.'),(666,26,9,'The patterns on this Pokémon’s wings depend on the climate and topography of its habitat. It scatters colorful scales.'),(667,26,9,'They set off on their own from their pride and live by themselves to become stronger. These hot-blooded Pokémon are quick to fight.'),(668,26,9,'With fiery breath of more than 10,000 degrees Fahrenheit, they viciously threaten any challenger. The females protect the pride’s cubs.'),(669,26,9,'When it finds a flower it likes, it dwells on that flower its whole life long. It floats in the wind’s embrace with an untroubled heart.'),(670,26,9,'When the flowers of a well-tended flower bed bloom, it appears and celebrates with an elegant dance.'),(671,26,9,'In times long past, governors of castles would invite Florges to create flower gardens to embellish the castle domains.'),(672,26,9,'If it has sunshine and water, it doesn’t need to eat, because it can generate energy from the leaves on its back.'),(673,26,9,'They inhabit mountainous regions. The leader of the herd is decided by a battle of clashing horns.'),(674,26,9,'It does its level best to glare and pull a scary face, but it can’t help grinning if anyone pats its head.'),(675,26,9,'It charges ahead and bashes its opponents like a berserker, uncaring about any hits it might take. Its arms are mighty enough to snap a telephone pole.'),(676,26,9,'Historically, in the Kalos region, these Pokémon were the designated guardians of the king.'),(677,26,9,'It has enough psychic energy to blast everything within 300 feet of itself, but it has no control over its power.'),(678,26,9,'The eyeball patterns on the interior of its ears emit psychic energy. It keeps the patterns tightly covered because that power is too immense.'),(679,26,9,'If anyone dares to grab its hilt, it wraps a blue cloth around that person’s arm and drains that person’s life energy completely.'),(680,26,9,'The complex attack patterns of its two swords are unstoppable, even for an opponent greatly accomplished at swordplay.'),(681,26,9,'Apparently, it can detect the innate qualities of leadership. According to legend, whoever it recognizes is destined to become king.'),(682,26,9,'In the past, rather than using perfume, royal ladies carried a Spritzee that would waft a fragrance they liked.'),(683,26,9,'Its scent is so overpowering that, unless a Trainer happens to really enjoy the smell, he or she will have a hard time walking alongside it.'),(684,26,9,'Because it eats nothing but sweets, its fur is as sticky sweet as cotton candy.'),(685,26,9,'Its sense of smell is 100 million times better than a human’s, so even the faintest scent tells it about everything in the area. It’s like it can see with its nose!'),(686,26,9,'It flashes the light-emitting spots on its body, which drains its opponent’s will to fight. It takes the opportunity to scuttle away and hide.'),(687,26,9,'It lures its prey close with hypnotic motions, then wraps its tentacles around it before finishing it off with digestive fluids.'),(688,26,9,'They stretch and then contract, yanking their rocks along with them in bold hops. They eat seaweed that washes up on the shoreline.'),(689,26,9,'Barbaracle’s legs and hands have minds of their own, and they will move independently. But they usually follow the head’s orders.'),(690,26,9,'It looks just like rotten kelp. It hides from foes while storing up power for its evolution.'),(691,26,9,'Tales are told of ships that wander into seas where Dragalge live, never to return.'),(692,26,9,'Through controlled explosions of internal gas, it can expel water like a pistol shot. At close distances, it can shatter rock.'),(693,26,9,'By expelling water from the nozzle in the back of its claw, it can move at a speed of 60 knots.'),(694,26,9,'The frills on either side of its head have cells that generate electricity when exposed to sunlight.'),(695,26,9,'It stimulates its muscles with electricity, boosting the strength in its legs and enabling it to run 100 yards in five seconds.'),(696,26,9,'Its immense jaws have enough destructive force that it can chew up an automobile. It lived 100 million years ago.'),(697,26,9,'Nothing could stop this Pokémon 100 million years ago, so it behaved like a king.'),(698,26,9,'This calm Pokémon lived in a cold land where there were no violent predators like Tyrantrum.'),(699,26,9,'Using its diamond-shaped crystals, it can instantly create a wall of ice to block an opponent’s attack.'),(700,26,9,'It wraps its ribbonlike feelers around the arm of its beloved Trainer and walks with him or her.'),(701,26,9,'With its wings, it controls its position in the air. It likes to attack from above, a maneuver that is difficult to defend against.'),(702,26,9,'It uses its tail to absorb electricity from power plants or from outlets in houses, and then it fires the electricity from its whiskers.'),(703,26,9,'It has slept underground for hundreds of millions of years since its birth. It’s occasionally found during the excavation of caves.'),(704,26,9,'It’s covered in a slimy membrane that makes any punches or kicks slide off it harmlessly.'),(705,26,9,'Its four horns are a high-performance radar system. It uses them to sense sounds and smells, rather than using ears or a nose.'),(706,26,9,'It attacks with retractable horns. It throws a punch that’s the equivalent of the force of a hundred pro boxers.'),(707,26,9,'It never lets go of a key that it likes, so people give it the keys to vaults and safes as a way to prevent crime.'),(708,26,9,'According to old tales, these Pokémon are stumps possessed by the spirits of children who died while lost in the forest.'),(709,26,9,'Using its roots as a nervous system, it controls the trees in the forest. It’s kind to the Pokémon that reside in its body.'),(710,26,9,'It is said to carry wandering spirits to the place where they belong so they can move on.'),(711,26,9,'It enwraps its prey in its hairlike arms. It sings joyfully as it observes the suffering of its prey.'),(712,26,9,'Using air of -150 degrees Fahrenheit, they freeze opponents solid. They live in herds above the snow line on mountains.'),(713,26,9,'The way several Bergmite huddle on its back makes it look like an aircraft carrier made of ice.'),(714,26,9,'Even a robust wrestler will become dizzy and unable to stand when exposed to its 200,000-hertz ultrasonic waves.'),(715,26,9,'The ultrasonic waves it emits from its ears can reduce a large boulder to pebbles. It swoops out of the dark to attack.'),(716,26,9,'When the horns on its head shine in seven colors, it is said to be sharing everlasting life.'),(717,26,9,'When its life comes to an end, it absorbs the life energy of every living thing and turns into a cocoon once more.'),(718,26,9,'It’s hypothesized that it’s monitoring those who destroy the ecosystem from deep in the cave where it lives.'),(719,26,9,'It can instantly create many diamonds by compressing the carbon in the air between its hands.'),(720,26,9,'It is said to be able to seize anything it desires with its six rings and six huge arms. With its power sealed, it is transformed into a much smaller form.'),(721,26,9,'It expels its internal steam from the arms on its back. It has enough power to blow away a mountain.'),(722,29,9,'It sends its feathers, which are as sharp as blades, flying in attack. Its legs are strong, so its kicks are also formidable.'),(723,29,9,'This narcissistic Pokémon is a clean freak. If you don’t groom it diligently, it will stop listening to you.'),(724,29,9,'It nocks its arrow quills and shoots them at opponents. When it simply can’t afford to miss, it tugs the vine on its head to improve its focus.'),(725,29,9,'If you try too hard to get close to it, it won’t open up to you. Even if you do grow close, giving it too much affection is still a no-no.'),(726,29,9,'It can act spoiled if it grows close to its Trainer. A powerful Pokémon, its sharp claws can leave its Trainer’s whole body covered in scratches.'),(727,29,9,'Although it’s rough mannered and egotistical, it finds beating down unworthy opponents boring. It gets motivated for stronger opponents.'),(728,29,9,'The balloons it inflates with its nose grow larger and larger as it practices day by day.'),(729,29,9,'It gets excited when it sees a dance it doesn’t know. This hard worker practices diligently until it can learn that dance.'),(730,29,9,'To Primarina, every battle is a stage. It takes down its prey with beautiful singing and dancing.'),(731,29,9,'It pecks at trees with its hard beak. You can get some idea of its mood or condition from the rhythm of its pecking.'),(732,29,9,'It can bend the tip of its beak to produce over a hundred different cries at will.'),(733,29,9,'They smack beaks with others of their kind to communicate. The strength and number of hits tell each other how they feel.'),(734,29,9,'Its stomach takes up most of its long torso. It’s a big eater, so the amount Trainers have to spend on its food is no laughing matter.'),(735,29,9,'Although it wasn’t originally found in Alola, this Pokémon was brought over a long time ago when there was a huge Rattata outbreak.'),(736,29,9,'If you find its nest, you shouldn’t stick your hand inside. You’ll get bitten by an irritated Grubbin.'),(737,29,9,'It buries itself in fallen leaves and barely moves, munching away on humus. If you accidentally step on one, you’ll get a shock!'),(738,29,9,'It has an organ that generates electricity in its abdomen. It concentrates energy in its strong jaws and fires off powerful jolts of electricity.'),(739,29,9,'Its hard pincers are well suited to both offense and defense. Fights between two Crabrawler are like boxing matches.'),(740,29,9,'It stores coldness in its pincers and pummels its foes. It can even smash thick walls of ice to bits!'),(741,29,9,'It wins the hearts of its enemies with its passionate dancing and then uses the opening it creates to burn them up with blazing flames.'),(742,29,9,'Nectar and pollen are its favorite fare. In fields of flowers, it gets into skirmishes with Butterfree over food.'),(743,29,9,'Rain makes pollen damp, so Ribombee hates rain. When it sees ominous clouds, it finds a hollow in a tree, where it waits stock-still.'),(744,29,9,'As they develop, their disposition grows more violent and aggressive. Many Trainers find them too much to handle and abandon them.'),(745,29,9,'The sharp rocks in its mane can cut like knives. Lycanroc wears its prey down by degrees before finishing them off.'),(746,29,9,'They’re weak, so they move in schools. However, they can also often be seen all alone, having strayed from the school.'),(747,29,9,'They eat Corsola branches, so Mareanie are hated by craftsmen who work with Corsola branches that have naturally fallen off.'),(748,29,9,'To attack, this Pokémon sends toxic spikes flying at its enemies. Ones that come close get mown down by the claws on its feet.'),(749,29,9,'It loves playing in the mud. If it isn’t showered with mud on a daily basis, it gets stressed out and stops listening to its Trainer.'),(750,29,9,'It remains calm and unmoving no matter the situation. It mixes dirt with the saliva in its mouth to make a special kind of mud.'),(751,29,9,'When two Dewpider meet, they display their water bubbles to each other. Then the one with the smaller bubble gets out of the other’s way.'),(752,29,9,'It usually passes its time in the water. When its belly is full, it stores its subdued prey in the water bubble on its head.'),(753,29,9,'When the sun rises, Fomantis spreads its four leaves and bathes in the sunlight. The tip of its head has a pleasant aroma.'),(754,29,9,'For self-protection, it pretends to be a bug Pokémon. Both of its arms bear keen-edged petals.'),(755,29,9,'It scatters its shining spores around itself. Even though they’re dangerous, nighttime tours of forests where Morelull live are popular.'),(756,29,9,'It puts its prey to sleep and siphons off their vitality through the tip of its arms. If one of its kind is weakened, it helps by sending it vitality.'),(757,29,9,'The males will do whatever the females tell them. They give the females most of their food. Due to malnutrition, the males can’t evolve.'),(758,29,9,'Salazzle lives deep in caves and forces the Salandit it has attracted with its pheromones to serve it.'),(759,29,9,'It boasts power enough to split large trees in half. The organ on its rear releases an odor that it uses to communicate with others of its kind.'),(760,29,9,'It waves its hands wildly in intimidation and warning. Life is over for anyone who doesn’t run away as fast as possible.'),(761,29,9,'Because of its sweet, delicious aroma, bird Pokémon are always after it, but it’s not intelligent enough to care.'),(762,29,9,'It’s protected by its hard sepals, so it plays with bird Pokémon without worry. They peck it relentlessly, but it doesn’t care.'),(763,29,9,'A master of grand and beautiful kicks, it can knock out even kickboxing champions with a single blow.'),(764,29,9,'It stretches sticky vines out from its head and picks flowers to adorn itself with. When it doesn’t have any flowers, it feels uneasy.'),(765,29,9,'It normally spends its time meditating in the treetops. It throws Poké Balls and gives other Pokémon orders as it pleases.'),(766,29,9,'They use their saliva to stick leaves to their shoulders. You can tell what troop they belong to from the position of the leaves.'),(767,29,9,'It will pick up anything it finds on the ground. Sometimes it finds coins, so Murkrow and Meowth will go after it.'),(768,29,9,'The shell covering its body is as hard as diamond. This Pokémon will do anything it takes to win.'),(769,29,9,'It likes the shovel on its head, so Sandygast will get serious and fight any children who come to take it back.'),(770,29,9,'Each of its grains of sand has its own will. Palossand eats small Pokémon and siphons away their vital essence while they’re still alive.'),(771,29,9,'The tradition known as Pyukumuku chucking started from the custom of throwing Pyukumuku back into the sea after they wash onshore.'),(772,29,9,'A Pokémon weapon developed for a specific mission, it went berserk during an experiment, so it was cryogenically frozen.'),(773,29,9,'This is its form once it has awakened and evolved. Freed from its heavy mask, its speed is greatly increased.'),(774,29,9,'It lives in the ozone layer, where it becomes food for stronger Pokémon. When it tries to run away, it falls to the ground.'),(775,29,9,'It stays asleep from the moment it’s born. When it falls into a deep sleep, it stops moving altogether.'),(776,29,9,'It lives in volcanoes and eats sulfur and other minerals. Materials from the food it eats form the basis of its explosive shell.'),(777,29,9,'When it’s surprised or agitated, the 14 fur spikes on its back will stand up involuntarily.'),(778,29,9,'Although it’s a quiet, lonely Pokémon, if you try to look at what’s under its rag, it will become agitated and resist violently.'),(779,29,9,'It burrows beneath the sand, radiating psychic power from the protuberance on its head. It waits for prey as it surveys the area.'),(780,29,9,'If a child it has made friends with is bullied, Drampa will find the bully’s house and burn it to the ground.'),(781,29,9,'It wraps its prey in green seaweed and sucks away their vitality. It only likes to go after big prey like Wailord.'),(782,29,9,'It smacks the scales on its head against rocks or against the ground to frighten its opponents. It can also contact its friends with these noises.'),(783,29,9,'It makes noise by clanging its scales together. When the rhythm has reached its peak, Hakamo-o attacks.'),(784,29,9,'When it howls after finishing off its prey, the metallic sounds of its celebrating comrades can be heard from all around.'),(785,29,9,'Although it’s called a guardian deity, if a person or Pokémon puts it in a bad mood, it will become a malevolent deity and attack.'),(786,29,9,'It heals the wounds of people and Pokémon by sprinkling them with its sparkling scales. This guardian deity is worshiped on Akala.'),(787,29,9,'Although it’s called a guardian deity, it’s violent enough to crush anyone it sees as an enemy.'),(788,29,9,'This guardian deity of Poni Island manipulates water. Because it lives deep within a thick fog, it came to be both feared and revered.'),(789,29,9,'Even though its helpless, gaseous body can be blown away by the slightest breeze, it doesn’t seem to care.'),(790,29,9,'The king who ruled Alola in times of antiquity called it the “cocoon of the stars” and built an altar to worship it.'),(791,29,9,'Sometimes the result of its opening an Ultra Wormhole is that energy and life-forms from other worlds are called here to this world.'),(792,29,9,'Records of it exist in writings from long, long ago, where it was known by the name “the beast that calls the moon.”'),(793,29,9,'A life-form from another world, it was dubbed a UB and is thought to produce a strong neurotoxin.'),(794,29,9,'Although it’s alien to this world and a danger here, it’s apparently a common organism in the world where it normally lives.'),(795,29,9,'A life-form that lives in another world, its body is thin and supple, but it also possesses great power.'),(796,29,9,'Although it’s alien to this world and a danger here, it’s apparently a common organism in the world where it normally lives.'),(797,29,9,'One of the dangerous UBs, high energy readings can be detected coming from both of its huge arms.'),(798,29,9,'This Ultra Beast’s body, which is as thin as paper, is like a sharpened sword.'),(799,29,9,'Although it’s alien to this world and a danger here, it’s apparently a common organism in the world where it normally lives.'),(800,29,9,'It looks somehow pained as it rages around in search of light, which serves as its energy. It’s apparently from another world.'),(801,29,9,'It synchronizes its consciousness with others to understand their feelings. This faculty makes it useful for taking care of people.'),(802,29,9,'It slips into the shadows of others and mimics their powers and movements. As it improves, it becomes stronger than those it’s imitating.');
